import React from "react";

const Login = () => {
  const mystyle = {
    backgroundImage: "url('backgroundimg.jpg')",
    height: "93vh",
    padding: "50px",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  return <div style={mystyle}>Login</div>;
};

export default Login;
